import { createRouter, createWebHistory} from 'vue-router'
import TRIVialeView from '../views/TRIVialeView.vue'
import LoginView from '../views/LoginView.vue'
import SecoureView from '../views/SecoureView.vue'

const routes = [
  {
    path: '/',
    name: 'TRIVial',
    component: TRIVialeView
  },
  {
    path: '/login',
    name: 'Login',
    component: LoginView
  },
  {
    path: '/secoure',
    name: 'Secoure',
    component: SecoureView
  },
]

const router = createRouter({
  history: createWebHistory(),
  routes
})


export default router
